import Link from 'next/link';

const HeaderStyle = {
    display: "flex",
    flex: 1,
    background:"#141414",
    height:"68px",
    alignItems:"center",
    justifyContent:"spaceAround"
}

const pageEnNames = ["","TvProgram","Movie","LatestContents","MyList"];
const pageKoNames = ["홈","티비 프로그램","영화","최신 콘텐츠","티비 프로그램"];
const pageLink = pageEnNames.map(pageLinks=>"/"+{pageLinks});
const pageName = pageKoNames.map(pageNames=><li><Link href="/"><a>{pageNames}</a></Link></li>);


const Header = () => (
    
    <div style={HeaderStyle}>
        
            {pageLink}
                {pageName}

        
    </div>
)

export default Header;
